import React from 'react';

 import
 { Container,
  StandPergunta,
  CountProficioalButton

 } from './styles';

function MobileCountProficionalButton() {
  return (

    <Container>

      <StandPergunta>
       É proprietário de um Stand?
      </StandPergunta>
      <CountProficioalButton>
        Crie uma Conta Profissional
      </CountProficioalButton>




    </Container>


  );
}

export default MobileCountProficionalButton;
